import React from "react";
import Subway from "./Subway";
import SubwaySlider from './SubwaySlider';

import data from '../dummy/restaurant.json';

const Test = () => {
    return (
        <>
        {/* <div>

        <SubwaySlider props={data.list[0].subway}/>
        </div> */}

        <div className='subway'>
            <div className='subway-top'>
                <div className='prev'><img src={process.env.PUBLIC_URL + `/rImg/달콤한위로.png`} /></div>
                <div className='content'><img src={process.env.PUBLIC_URL + `/rImg/달콤한위로.png`} /></div>
                <div className='next'><img src={process.env.PUBLIC_URL + `/rImg/달콤한위로.png`} /></div>
            </div>
        </div>
        <div>
            <h1>Here is SubwaySlider.js components position</h1>
        </div>

        </>
    );
}
export default Test;
